import React from 'react';
import { Nav, Logo } from './styled-components';

class Navigation extends React.Component {
  render() {
    return (
      <Nav isRed={true}>
        <Logo text="BookStore CMS" />
        <ul>
          <li>Books</li>
          <li>Categories</li>
        </ul>
      </Nav>
    )
  }
}

export default Navigation;
